import React, { Component } from "react";
import Navbarr from "../Navbar/Navbar";
import Serverservice from "../../Services/Serverservice";
import "../Home/Home.css";
export default class Yourevents extends Component {
  state = {
    events: [],
  };
  componentDidMount() {
    const data = {
      id: localStorage.getItem("id"),
    };
    Serverservice.getyourevents(data)
      .then((response) => {
        console.log(response);
        this.setState({
          events: response.data.events,
        });
        console.log(this.state.events);
      })
      .catch((err) => {
        console.log(err.response);
      });
  }
  render() {
    return (
      <div>
        <Navbarr />
        <div class="project" style={{ width: "100%" }}>
          <a href="#abhay">
            <div>
              <div class="card">
                <img src={m1} alt="Avatar" style={{ width: "100%" }} />
              </div>
              <div className="mt-1 ml-2">
                <h4 className="text-dark">abhy</h4>
                <p className="text-muted">Drama</p>
              </div>
            </div>
          </a>
          <div>
            <div class="card">
              <img src={m2} alt="Avatar" style={{ width: "100%" }} />
            </div>
            <div className="mt-1 ml-2">
              <h4>abhy</h4>
              <p className="text-muted">Drama</p>
            </div>
          </div>
          <div>
            <div class="card">
              <img src={m3} alt="Avatar" style={{ width: "100%" }} />
            </div>
            <div className="mt-1 ml-2">
              <h4>abhy</h4>
              <p className="text-muted">Drama</p>
            </div>
          </div>
          <div>
            <div class="card">
              <img src={m4} alt="Avatar" style={{ width: "100%" }} />
            </div>
            <div className="mt-1 ml-2">
              <h4>abhy</h4>
              <p className="text-muted">Drama</p>
            </div>
          </div>
          <div>
            <div class="card">
              <img src={m4} alt="Avatar" style={{ width: "100%" }} />
            </div>
            <div className="mt-1 ml-2">
              <h4>abhy</h4>
              <p className="text-muted">Drama</p>
            </div>
          </div>
        </div>
        <ul>
          {this.state.events.map((data) => {
            return <li> {data} </li>;
          })}
        </ul>
      </div>
    );
  }
}
